import { useDispatch } from "react-redux"
import { modalBookActions } from 'store/features/mainCard/modalSlice';

const Overlay = () => {

    const dispatch = useDispatch();
    
    return(
        <div>
            dispatch(modalBookActions.closeModal)
        </div>
    )
}

const BookModal = (props) => {

    return (
        <div>
            {props.text}
        </div>
    )
}

export default BookModal;
